    false,nt"url": null,nt"notes": "Gasoline retail prices weekly average by
    region dataset provides the weekly average retail gasoline prices for New York State
    and eight New York metropolitan regions in U.S. dollars per gallon.  Data is a weekly
    average from October 2007 through current.rnrnAverage daily retail gasoline prices
    are collected from the American Automobile Association (AAA) Daily Fuel Gauge Report.
     The AAA Daily Fuel Gauge Report prices are averaged to produce a weekly average
    retail price for New York State and each metropolitan region.rnrnThe New York State
    metropolitan regions in the dataset are Albany (Albany-Schenectady-Troy), Binghamton,
    Buffalo (Buffalo-Niagara Falls), Nassau (Nassau-Suffolk), New York City, Rochester,
    Syracuse, and Utica (Utica-Rome).",nt"license_title": "License Not Specified",nt"extras":
